import logo from './logo.svg';
import './App.css';

function App() {
  return (
    // Make a container for the product cards grid
    <div className="container">
      {/* Define row for the product cards grid */}
      <div className="row">
        {/* Define column for the product card */}
        <div className="col-3">
          <div className="card" styleName="width: 12rem;">
            <img src="..." className="card-img-top" alt="..."/>
              <div className="card-body">
              <h5 className="card-title">Card title</h5>
              <p className="card-text">Some quick example text to build on the card title and make up the bulk of the card's content.</p>
            </div>
            <ul className="list-group list-group-flush">
              <li className="list-group-item">An item</li>
              <li className="list-group-item">A second item</li>
              <li className="list-group-item">A third item</li>
            </ul>
            <div className="card-body d-grid gap-2 d-md-block mx-auto">
              <button type="button col-6" className="btn btn-primary">View</button>
            </div>
          </div>
        </div>
      </div>
    </div>  
  );
}

export default App;
